    const ondisplay = () => {
        if (type === "login") {
            setHomeData("login")
        } else {
            setHomeData("register")
        }
    }
    return (
        <div>
            {
                homeData === "login" ? (
                    <div>
                        <Login />
                        <p>or</p>
                        <button onClick={() => ondisplay("register")}>Create Account</button>
                    </div>
                ) :
                    (<div>
                        <Register/>
                        <p>or</p>
                        <button onClick={()=>ondisplay("login")}></button>

                    </div>)
            }
        </div>
    )
}

export default Home
